export function CarouselItem({ slide, stopSlide, startSlide }) {
    return (
      <div className="carousel-item" onMouseEnter={stopSlide} onMouseOut={startSlide}>
        <img src={slide} alt="" />
        <div class="overlay">
          <div class="overlay-text">Hello World</div>
        </div>
      </div>
    );
}
